import { Axios } from "axios";
import React, { useEffect, useState } from "react";
import AddExamen from "../componets/AddExamen";
import Modal from "../componets/Modal";
import {Url,headers} from '../config'
export function Examenes(props) {
    const [AcitveModal,setAcitveModal] = useState(false);
    const [data,setdata] = useState([]);
    const [refresh,setrefresh] = useState(false);
    headers.Authorization = 'Bearer ' + localStorage.getItem('Token')
    useEffect(() => {

      Axios.get(Url+"Examen/Gets",{headers}).then(res=>{
        if(res.data.ok){setdata(res.data.data)}

      }).catch(error=>console.log(error))

    }, [refresh])
  return (
    <div className="container  min-h-screen">
      {AcitveModal&&<Modal cerrar={()=>setAcitveModal(false) } titulo={'Agregar Paciente'}><AddExamen/></Modal>}
      <button onClick={()=>setAcitveModal(true)} className="m-4 bg-green-primary py-2 px-4 rounded-lg text-white text-lg"> + Agregar Examen</button>

      <table className="bg-white w-8/12 mx-auto mt-6 rounded-t-lg">
        <thead className="bg-blue-primary text-white rounded-t-lg">
          <tr className="text-xl rounded-t-lg">
            <th className="rounded-tl-lg">Examen</th>
            <th className="rounded-tr-lg">Descripcion</th>
          </tr>
        </thead>
        <tbody className="text-center">
          {data.map((element,i) => {
            if(i%2===0){
                return (
                    <tr className="bg-white">
                      <td>{element[0]}</td>
                      <td>{element[1]}</td>
                    </tr>
                  );
            }
            return (
                <tr className="bg-gray-200">
                  <td>{element[0]}</td>
                  <td>{element[1]}</td>
                  {/* <th onClick={()=>eliminar(element.Cedula)} className='py-2 bg-red-500 ml-2 border border-red-500 cursor-pointer  hover:bg-white hover:text-red-500   '><Basura/></th> */}
                </tr>
              );
          })}
        </tbody>
      </table>
    </div>
  );
}
